import "../styleComponents/button.css"

const Button = ({ btn_text }) => {
  function effect() {
    var btn = document.getElementsByClassName("btnn")
    btn.classList.add("jse")
    setTimeout(() => {
      btn.classList.remove("jse")
    }, 200);
  }
  return (
      <button class="btnn animated-button">
        <span></span>
        <span></span>
        <span></span>
        <span></span>
        {btn_text}
      </button>
    );
}

export default Button;
